import PySimpleGUI as sg
from time import time

gif = b''


def main(tiempo_total):
    layout = [
        [sg.Text("", key="-TIMER-")],
        [[sg.Image(data=gif, enable_events=True, background_color='white', key='-IMAGE-', right_click_menu=['UNUSED', ['Exit']], pad=0)],
        [[sg.Button("Iniciar", key="-INICIAR-", button_color='black'), sg.Button("Detener", key="-DETENER-", button_color='red')],
    ],
    ]
    ]

    window = sg.Window("Timer", layout, finalize=True, margins=(200, 150), element_justification="bottom")
    hora_inicial = time()
    restantes = None
    while True:
        event, values = window.read(timeout=100)
        if event == sg.WIN_CLOSED or event == 'Salir':
            break
        if event != 'Detener' and hora_inicial:
            transcurridos = int(time() - hora_inicial)
            restantes = tiempo_total - transcurridos
            if restantes <= 0:
                hora_inicial = None
                window["-TIMER-"].update("Tiempo agotado")
            else:
                window["-TIMER-"].update(f"Quedan {restantes} segundos")
        match event:
            case "-DETENER-":
                hora_inicial = None
                window["-TIMER-"].update("Detenido")
            case "-INICIAR-":
                hora_inicial = time()
        window["-IMAGE-"].update_animation(gif,  time_between_frames=100)
    window.close()

if __name__ == "__main__":
    main(tiempo_total=25)

